import React, { useEffect, useState, useCallback } from 'react';
import axios from 'axios';
import {
  Box,
  Grid,
  Typography,
  Card,
  CardContent,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  Skeleton,   // âœ… added
} from '@mui/material';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
  PieChart,
  Pie,
  Cell,
} from 'recharts';

const DashboardPage = () => {
  const [loading, setLoading] = useState(true);
  const [overview, setOverview] = useState(null);

  const fetchData = useCallback(async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.get('http://localhost:5000/api/dashboard/overview', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setOverview(res.data);
      setLoading(false);
    } catch (err) {
      console.error(err);
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchData();
  }, [fetchData]);

  if (loading) {
    return (
      <Box sx={{ padding: 3 }}>
        <Grid container spacing={3}>
          {/* KPI Skeletons */}
          {[...Array(4)].map((_, i) => (
            <Grid key={i} item xs={12} sm={6} md={3}>
              <Skeleton variant="rectangular" height={100} />
            </Grid>
          ))}

          {/* Chart Skeletons */}
          <Grid item xs={12} md={8}>
            <Skeleton variant="rectangular" height={300} />
          </Grid>
          <Grid item xs={12} md={4}>
            <Skeleton variant="rectangular" height={300} />
          </Grid>

          {/* Table Skeletons */}
          <Grid item xs={12} md={6}>
            <Skeleton variant="rectangular" height={250} />
          </Grid>
          <Grid item xs={12} md={6}>
            <Skeleton variant="rectangular" height={250} />
          </Grid>
        </Grid>
      </Box>
    );
  }

  return (
    <Box sx={{ padding: 3 }}>
      {/* KPI Cards */}
      <Grid container spacing={3}>
        <Grid item xs={12} sm={6} md={3}>
          <Card><CardContent><Typography variant="h6">Total Customers</Typography><Typography variant="h4">{overview?.totalCustomers}</Typography></CardContent></Card>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <Card><CardContent><Typography variant="h6">Total Orders</Typography><Typography variant="h4">{overview?.totalOrders}</Typography></CardContent></Card>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <Card><CardContent><Typography variant="h6">Total Revenue</Typography><Typography variant="h4">â‚¹{overview?.totalRevenue}</Typography></CardContent></Card>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <Card><CardContent><Typography variant="h6">Total Products</Typography><Typography variant="h4">{overview?.totalProducts}</Typography></CardContent></Card>
        </Grid>

        {/* Main Line Chart */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent>
              <Typography variant="h6">Orders Over Time</Typography>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={overview?.ordersOverTime || []}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="date" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Line type="monotone" dataKey="count" stroke="#8884d8" />
                </LineChart>
              </ResponsiveContainer>
            </CardContent>
          </Card>
        </Grid>

        {/* Donut Chart */}
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6">Product Distribution</Typography>
              <ResponsiveContainer width="100%" height={300}>
                <PieChart>
                  <Pie data={overview?.productDistribution || []} dataKey="value" nameKey="name" cx="50%" cy="50%" outerRadius={80} label>
                    {(overview?.productDistribution || []).map((entry, index) => (
                      <Cell key={`cell-${index}`} fill={['#8884d8', '#82ca9d', '#ffc658'][index % 3]} />
                    ))}
                  </Pie>
